import React from "react";
import { Navbar } from "reactstrap";
import { Link } from "react-router-dom";
import BarChartIcon from '@material-ui/icons/BarChart';
import ListIcon from '@material-ui/icons/List';
import AddCircleOutlineIcon from '@material-ui/icons/AddCircleOutline';
import PlaylistAddIcon from '@material-ui/icons/PlaylistAdd';
import PostAddIcon from '@material-ui/icons/PostAdd';
import PersonAddIcon from '@material-ui/icons/PersonAdd';
import ExitToAppIcon from '@material-ui/icons/ExitToApp';

const NavBar = (props) => {
  const hasUser = props.hasUser;
  const clearUser = props.clearUser

  return (
    <>
      <Navbar align="right">
        {hasUser ? <Link to="/entry/form"><PlaylistAddIcon color="action"/></Link> : null}
        {hasUser ? <Link to="/location/log"><ListIcon size="small" color="action"/></Link> : null}
        {hasUser ? <Link to="/route/report"><BarChartIcon color="action"/></Link> : null}
        {hasUser ? <Link to="/login" onClick={clearUser}><ExitToAppIcon color="action"/></Link> : null}
        {hasUser ? null : <Link to="/login"><ExitToAppIcon color="action"/></Link>}
        {hasUser ? null : <Link to="/register"><PersonAddIcon color="action"/></Link>}
      </Navbar>
    </>
  );
};

export default NavBar;
